loadFunctionsAndDefinitions[weight_]:=Block[{},	
    dsHeptagonArguments = {{u1*u4, u2*u6}, {u2*u5, u3*u7}, {u3*u6, u1*u4}, {u4*u7, u2*u5}, {u1*u5, u3*u6}, {u2*u6, u4*u7}, {u3*u7, u1*u5}, {u2*u6, u1*u4}, {u3*u7, u2*u5}, {u1*u4, u3*u6}, {u2*u5, u4*u7}, {u3*u6, u1*u5}, {u4*u7, u2*u6}, {u1*u5, u3*u7}};
    dtHeptagonArguments = {{u4,u7},{u1,u5},{u2,u6},{u3,u7},{u1,u4},{u2,u5},{u3,u6},{u7,u4},{u5,u1},{u6,u2},{u7,u3},{u4,u1},{u5,u2},{u6,u3}};
    knownCurrentWeightFunctions=Join[DeleteDuplicates[Flatten[Table[Symbol["ds"<>ToString[weight]][ii]@@@dsHeptagonArguments,{ii,numFuncs[Symbol["ds"<>ToString[weight]]]}]]],DeleteDuplicates[Flatten[Table[Symbol["dt"<>ToString[weight]][ii]@@@dtHeptagonArguments,{ii,numFuncs[Symbol["dt"<>ToString[weight]]]}]]/.{-dt4[ii_][a_,b_]:>dt4[ii][a,b],-dt6[ii_][a_,b_]:>dt6[ii][a,b],-dt7[ii_][a_,b_]:>dt7[ii][a,b],-dt8[ii_][a_,b_]:>dt8[ii][a,b]}],HPLbasisHeptagon[weight],compositeFuncsHeptagon[weight],heptagonBeyondSymbolTerms[weight]];
	previousWeightFunctions=heptagonFunctionsWeight[weight-1];
	previousPreviousWeightFunctions=heptagonFunctionsWeight[weight-2];

	independentFunctions=Flatten@Table[t[i,AngleBracket@@j],{i,Length@previousPreviousWeightFunctions},{j,uniquePairs}];
	t[x_,Plus[y_,z__]]:=Plus@@Table[t[x,List[y,z][[i]]],{i,Length@List[y,z]}];
	t[x_,a_ \[LeftAngleBracket]y_,z_\[RightAngleBracket]]:=a t[x,\[LeftAngleBracket]y,z\[RightAngleBracket]]/;NumericQ[a];
	t[x_,0]:=0;

    previousWeightTerms=DeleteCases[previousWeightFunctions,Alternatives@@pureMZV];
	coefficients=Flatten[Table[h[l,m],{l,Length@previousWeightTerms},{m,heptagonLetters}]];];

functionToVector[func_]:=functionToVectorBasis[Expand[func/.HPL[{1},1-var1_*var2_]:>(HPL[{1},1-var1]+HPL[{1},1-var2])]];
functionToVectorBasis[0]:=ConstantArray[0,Length@coefficients];
functionToVectorBasis[func_]:=Module[{sparse=CoefficientArrays[toCoefficients[Expand[func]],coefficients]}, If[sparse[[1]]!=0,Print["Function could not be converted to vector because of these terms: "<>ToString[sparse[[1]]]]]; Normal[sparse[[2]]]];

vectorToFunction[vec_]:=vec.coefficients/.{h[x_,y_]:>CircleDot[previousWeightTerms[[x]],Log[y]]};
toCoefficients[Plus[func1_,funcN__]]:=Sum[toCoefficients[i],{i,List[func1,funcN]}];
toCoefficients[func_]:=(func/.{CircleDot[x_,y_]:>h[Position[previousWeightTerms,x][[1,1]],y]}/.toLogs/.Log[y_]:>y);
